import React from 'react';

interface IButtonProps {
  name: string;
  onClick: () => void;
  color:string
}

const Button: React.FC<IButtonProps> = ({ name, onClick,color }) => {
  return (
    <button onClick={onClick} backgroundColor='#9413dc'>
      {name}
    </button>
  );
};

export default Button
